import React, { useEffect, useState } from 'react'
import Axios from "axios";
import Button from '@mui/material/Button';
import { Link } from 'react-router-dom';


const App = () => {
  const [data, setData]=useState();

  const getData=async()=>{
    const response=await Axios.get("http://localhost:5001/getData");
    setData(response.data);
  }

  useEffect(()=>{
    getData()
  }, []);

  const MyLink = props => <Link to="/student-login.js" {...props} />

  return (
    <div>
      {data}
      <Button  color="primary">
        MyButton
      </Button>
      {/* <Button variant="contained" component={MyLink} >Student Log-In</Button> */}
      <Button variant="contained">Professor Log-In</Button>
    </div>
  )
}

export default App
